import React, { useState, useEffect } from "react";
import axios from "axios";

function Demo1() {
  const [count, setCount] = useState(10);
  const [name, setName] = useState("");
  const [lastName, setLastName] = useState("");
  const [companyDetails, setCompanyDetails] = useState("");

  function kajal() {
    setCount(count + 1);
  }

  useEffect(() => {
    let reqOptions = {
      url: "https://retoolapi.dev/oFLQoK/data",
      method: "GET",
    };

    axios.request(reqOptions).then(function (response) {
      console.log(response.data);
      setCompanyDetails(response.data);
    });
  }, []);

  const saveData = {
    name: name,
    lastName: lastName,
  };

  useEffect(() => {
    console.log(saveData);
  }, [saveData]);

  return (
    <div>
      <div>
        <button
          onClick={kajal}
          className="bg-red-500 p-5 rounded-full text-center"
        >
          Click me
        </button>
        {count}
      </div>
      <div>name</div>
      <input
        type="text"
        className="bg-blue-500"
        onChange={(e) => setName(e.target.value)}
      ></input>
      <div className="bg-green-500 text-lg font-monts">{name}</div>
      <div>lastname</div>
      <input
        type="text"
        className="bg-blue-500"
        onChange={(e) => setLastName(e.target.value)}
      ></input>
      <div className="bg-green-500 text-lg font-monts">{lastName}</div>

      <div className="h-[500px] w-[1000px] bg-red-400 m-auto">
        <div className="overflow-y-auto">
          {companyDetails &&
            companyDetails.map((user, index) => {
              return (
                <div className="flex justify-around" key={index}>
                  <h1 className="w-[20%]">Name:{user.fullName}</h1>
                  <h1 className="w-[20%]">Product Id: {user.pId}</h1>
                  <h1 className="w-[20%]">Company Id: {user.cId}</h1>
                  <h1 className="w-[20%]">Industry : {user.Industry}</h1>
                </div>
              );
            })}
        </div>
      </div>
    </div>
  );
}

export default Demo1;
